components.calculateValue:
var groups = data.keycloakContext && data.keycloakContext.groups;
if (groups) {
  var groupsLength = groups.length;
  var groupsFormatted = [];

  for (var i = 0; i < groupsLength; i++) {
   groupsFormatted.push(
    groups[i].replace('/', '').replace(/_/g, ' ')
   );
  }

  value = groupsFormatted;
}
